const Table = () => {
const data = [
    {time: 1, day: 'one'},
    {time: 2, day: 'two'},
    {time: 3, day: 'three'},
]

  return (
    <div>
      <table>
       <tbody>
        {
            data.map((el, index) => {
                return (
                    <tr key={index}>

                    </tr>
                )
            })
        }
       </tbody>
      </table>
    </div>
  )
}

export default Table
